const casual = require('casual')
module.exports = () => {
    const db = { animals: [], homes: [] }

    for (let i = 0; i <= 100; i++) {
        const animal = {}
        animal.id = i
        animal.name = casual.name
        animal.age = casual.integer(1, 20)
        animal.breed = casual.word
        animal.type = casual.random_element(['dog', 'cat'])
        animal.gender = casual.random_element(['male', 'female'])
        animal.description = casual.description
        animal.dayOfBirth = casual.moment
        animal.country = casual.country
        animal.address = casual.address
        animal.avaliable = casual.random_element([true, false])
        animal.img = casual.random_element([
            'data:image/jpeg;base64,',
            'https://upload.wikimedia.org/wikipedia/commons/thumb/4/4d/Cat_November_2010-1a.jpg/1200px-Cat_November_2010-1a.jpg',
            'data:image/jpeg;base64,',
            'data:image/jpeg;base64,',
            'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ8D-G0b8ka5kyWMioBDY98SOJCYt8Xy7kklA&usqp=CAU',
        ])
        db.animals.push(animal)
    }
    for (let i = 0; i < 1; i++) {
        const home = {}
        home.title = casual.title
        home.description = casual.description
        home.img = casual.random_element([
            'data:image/jpeg;base64,',
        ])
        db.homes.push(home)
    }
    return db
}
